import React from 'react';

import './App.css';

function App() {
  return (

      <div className="grid-container">
        <header className="header">
         <h1>Dairy milk<br></br> products</h1>
        </header>

        <main className="main">
         <p>Welcome to our our website</p>
        </main>
        <footer className="footer">All right reserved.</footer>
      </div>

  );
}

export default App;
